import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '100vh',
        width: '100%',
    },
    titleContainer: {
        position: 'absolute',
        width: '100%',
        height: '80%',
        borderColor: 'black',
        borderWidth: '1px',
    }
});
